import React from "react";

import { v4 as uuidv4 } from "uuid";

class QuestionItem extends React.Component {

    render() {
        return (
            <li key={uuidv4()}>
                <span style={{
                    "marginLeft": "50px",
                    "fontSize": "23px"
                }}>{this.props.quest.text}</span>
            </li>

        )
    }
}

export default QuestionItem
